// src/MandateAccessButton.js

import React, { useState } from 'react';
import axios from 'axios';

const MandateAccessButton = () => {
  const [traderData, setTraderData] = useState(null);
  const [error, setError] = useState(null);

  const fetchData = async () => {
    try {
      setError(null); // Reset error state
      const response = await axios.get('http://localhost:3003/0');
      console.log('Response data:', response.data); // Log the response data

      if (response.data && response.data.length > 0) {
        const mandates = response.data[0].traderMandates;
        if (mandates.length > 0) {
          const { traderMandateId, traderName } = mandates[0];
          console.log('Trader Name:', traderName, 'Trader ID:', traderMandateId); // Log the trader data
          setTraderData({ traderMandateId, traderName });
        } else {
          console.log('No trader mandates found');
        }
      } else {
        console.log('No data found');
      }
    } catch (error) {
      console.error('Error fetching data:', error);
      setError('Failed to fetch data');
    }
  };

  return (
    <div>
      <button onClick={fetchData}>
        Generate Mandate Access
      </button>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      {traderData ? (
        <div>
          <p>Trader Name: {traderData.traderName}</p>
          <p>Trader ID: {traderData.traderMandateId}</p>
        </div>
      ) : (
        <p>No trader data available</p>
      )}
    </div>
  );
};

export default MandateAccessButton;
